operations.content:
mutation CompleteAllTodos($completed: Boolean!) {
  data: todo_updateManyTodo(data: {completed: {set: $completed}}) {
    count
  }
}

mutation CompleteTodo($completed: Boolean = false, $id: String = "") {
  data: todo_updateOneTodo(data: {completed: {set: $completed}}, where: {id: $id}) {
    id
  }
}

mutation CreateTodo($id: String!, $title: String!) {
  data: todo_createOneTodo(data: {id: $id, title: $title, completed: false}) {
    id
    completed
    title
  }
}

query GetAllTodos {
  data: todo_findManyTodo {
    completed
    id
    title
  }
}

mutation RemoveCompleted {
  data: todo_deleteManyTodo(where: {completed: {equals: true}}) {
    count
  }
}

mutation UpdateTodoTitle($id: String!, $title: String!) {
  todo_updateOneTodo(data: {title: {set: $title}}, where: {id: $id}) {
    id
  }
}
